import { SET_LOGIN_MODAL_WINDOW } from "../action-types";

const initialState = {
    loginPopup: false
}

const headerPopup = (state = initialState, action) => {
  switch (action.type) {
    case SET_HEADER_POPUP_FALSE: {
      return false;
    }
    default: {
      return state;
    }
  }
};

export default modals;
